import React from 'react';
import s from './Users.module.css';

const Users = (props) => {
	return (
		<div>
			{
				props.users.map( u => <div key={u.id}>
					<div className={s.pic}>
						<img src={u.img} alt=""/>
					</div>
					<button className={s.followBtn}>
						Follow
					</button>
				</div>)
			}
		</div>
	);
};

export default Users;
